class Usermodel {
  Usermodel({
      String? status, 
      String? token, 
      Data? data,}){
    _status = status;
    _token = token;
    _data = data;
}

  Usermodel.fromJson(dynamic json) {
    _status = json['status'];
    _token = json['token'];
    _data = json['data'] != null ? Data.fromJson(json['data']) : null;
  }
  String? _status;
  String? _token;
  Data? _data;
Usermodel copyWith({  String? status,
  String? token,
  Data? data,
}) => Usermodel(  status: status ?? _status,
  token: token ?? _token,
  data: data ?? _data,
);
  String? get status => _status;
  String? get token => _token;
  Data? get data => _data;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = _status;
    map['token'] = _token;
    if (_data != null) {
      map['data'] = _data?.toJson();
    }
    return map;
  }

}

